  input: TEXT,F3XA,,"In response to your letter of November 24, 2004 regarding our
    October Monthly Report 9/1/04-9/30/04), the totals of the Summary and Detailed
    Summary Pages are now correct.  The problem on Schedule D is the same as previously
    addressed.  There was a probem with the software that tech support has since fixed.
    With regard to the identification of all individuals who contribute in excess
    of $200 in a calendar year, it should be noted that we routinely include in our
    solicitations for contribution requests  for contributor information and an explanation
    of the federal law requirements for reporting the same.  Our normal follow-up
    procedure is to call (if local) the contributor to request the missing information.  If
    unable to call, we send a letter to the contributor with a response section and
    a business reply envelope to return it in.  Schedule B payments totaling $39,381.73
    for 'direct mail' and 'direct mail expense' and telemarketing were all for solicitation
    and fundraising and marked accordingly.  None were for any candidates.  We have
    corrected all disbursements on Schedule B and Schedule H4.  We apologize for any
    inconvenience."
